import React, { Component } from "react";
import { ImageBackground, StyleSheet, Text, View } from "react-native";
import LoginComponent from "../../components/session/loginComponent";
import { commonStyles } from "../../styles/common/common.styles";
import { landingStyles } from "../../styles/components/screens/landing.screen.style";

class LandingScreen extends Component {
    constructor(props) {
        super(props);

        this.state = {
            type: 'login'
        }
    }

    render() {
        const banner = { uri: "./assets/home-interior.png" };
        return(
            <View style={[commonStyles.container, landingStyles.container]}>
                <ImageBackground
        style={{flex: 1}}
        //We are using online image to set background
        source={{
          uri:
            'https://raw.githubusercontent.com/AboutReact/sampleresource/master/crystal_background.jpg',
        }}
        //You can also set image from your project folder
        //require('./images/background_image.jpg')
      >
        <View style={styles.container}>
          <Text style={styles.titleStyle}>
            Example of React Native Swipe Button
          </Text>
        </View>
      </ImageBackground>
            </View>
        )
    }
};

export default LandingScreen;


const styles = StyleSheet.create({
    container: {
      flex: 1,
      padding: 10,
    },
    titleStyle: {
      fontSize: 28,
      fontWeight: 'bold',
      textAlign: 'center',
      padding: 10,
    },
    centerContentStyle: {
      justifyContent: 'center',
      alignItems: 'center',
    },
  });
